	def createproject(self, name, path, author, ver, desc):
		pathrepl = path.replace("\\", r"\\")
		os.makedirs(pathrepl + "\\" + name)
		data = '{\n\t"name": "' + name + '",\n\t"author": "' + author + '",\n\t"version": "' + ver + '",\n\t"desc": "' + repr(desc) + '"\n}'
		currpath = os.getcwd()
		os.chdir(path + "\\" +  name)
		mkconffile = open("config.pwgproj", 'w+')
		mkconffile.write(data)
		mkconffile.close() 
		os.chdir(currpath)

	def check_n_create(self, event):
		err = 0
		errText  = "Error!"
		name___ = self.projectname.GetValue()
		path___ = self.projectpath.GetValue()
		author___ = self.author.GetValue()
		version___ = self.version.GetValue()
		description___ = self.description.GetValue()
		if not description___:	
			description___ = "none"
		if not version___:
			version___= "1.0"

		
		if (name___ == ""):
			errText = errText + "\nYou need to set some name!"
			err=err+1
		
		if (author___ == ""):
			author___ = getpass.GetUser()

		if (err==0):
			print("A Project will be created:\nName: " + name___ + "\nin directory: " + path___ + "\nmade by: """ +author___ + ".\nVersion of project is: " + version___ + ".\nDescription of project is: " + description___)
			self.createproject(name___, path___, author___, version___, description___)
			frame = editorFrame()
			frame.Show()
			self.Destroy()
			return 0
		else:
			print(errText)

		






